(110, 'widget_custom_html', 'a:2:{i:2;a:2:{s:5:"title";s:15:"Admission Forms";s:7:"content";s:2049:"<!DOCTYPE html>\r\n<html>\r\n<head>\r\n	<title>Form Layout</title>\r\n	<link rel="stylesheet" type="text/css" href="css/form.css ">\r\n</head>\r\n<body>\r\n<form method="post" action="" autocomplete="off" enctype="multipart/form-data"><!--method may be get-->\r\n	<table class="form-box form-bg">\r\n		<tr>\r\n			<td><label>Name<sup>*</sup></label> </td>\r\n			<td><input type="text" name="name" size="30" placeholder="Enter your name" required></td>	\r\n		</tr>\r\n		<tr>\r\n			<td><label>Email</label></td>\r\n			<td><input type="email" name="email" size="30" placeholder="Enter your email" required></td>\r\n		</tr>\r\n		<tr>\r\n			<td><label>Gender</label></td>\r\n			<td><input type="radio" name="gender" value="male" required checked> Male <input type="radio" name="gender" value="female"> Female</td>\r\n		</tr>\r\n		<tr>\r\n			<td><label>Language</label></td>\r\n			<td><input type="checkbox" name="hindi" value="hindi" checked> Hindi <input type="checkbox" name="english" value="english"> English</td>\r\n		</tr>\r\n		<tr>\r\n			<td><label>DOB</label></td>\r\n			<td><input type="date" name="dob" class="form-control"></td>\r\n		</tr>\r\n		<tr>\r\n			<td><label>Photo</label></td>\r\n			<td><input type="file" name="photo"></td>\r\n		</tr>\r\n		<tr>\r\n			<td><label>City</label></td>\r\n			<td><select name="city" class="form-control">\r\n				<option>--select city--</option>\r\n				<option>Delhi</option>\r\n				<option>Noida</option>\r\n				<option selected>Agra</option>\r\n			</select></td>\r\n		</tr>\r\n		<tr>\r\n			<td><label>Website</label></td>\r\n			<td><input type="url" name="web" class="form-control" placeholder="www.example.com"></td>\r\n		</tr>\r\n		<tr>\r\n			<td><label>Joining Time(Days)</label></td>\r\n			<td><input type="number" name="joining" class="form-control" min="1" max="15" value="1" required></td>\r\n		</tr>\r\n		<tr>\r\n			<td><label>Security</label></td>\r\n			<td><input type="password" name="scode" class="form-control" placeholder="Security code" required=""></td>\r\n		</tr>\r\n		<tr>\r\n			<td><input type="submit" class="btn" name="save" value="Register"></td>\r\n		</tr>\r\n	</table>	 \r\n</form>\r\n</body>\r\n</html>";}s:12:"_multiwidget";i:1;}', 'yes'),
