(32, 1, '2018-11-28 07:40:46', '2018-11-28 07:40:46', '<table style="height: 574px;" border="0" width="610" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td class="title" valign="top" width="380"><img class="alignnone size-medium wp-image-36" src="http://localhost/myproject/aktheme/wp-content/uploads/2018/11/lorem_ipsum_sit_dolor-300x80.jpg" alt="" width="300" height="80" />\r\n\r\n<strong>What is Lorem ipsum?</strong>\r\n<p class="text">A quick and simplified answer is that Lorem Ipsum refers to text that the DTP (Desktop Publishing) industry use as replacement text when the real text is not available.</p>\r\n<p class="text">For example, when designing a brochure or book, a designer will insert Lorem ipsum text if the real text is not available. The Lorem ipsum text looks real enough that the brochure or book looks complete. The book or brochure can be shown to the client for approval.</p>\r\n<p class="text">The important factor when using Lorem ipsum text is that the text looks realistic otherwise the brochure or book will not look very good. Lorem Ipsum is dummy text which has no meaning however looks very similar to real text.</p>\r\n<p class="text">Common names for Lorem ipsum text include:</p>\r\n<p class="text">- blind text\r\n- dummy text\r\n- greeked text\r\n- placeholder text\r\n- mock content\r\n- filler text</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\nThe lorem ipsum text is typically a scrambled section of<i><a title="De finibus bonorum et malorum" href="https://en.wikipedia.org/wiki/De_finibus_bonorum_et_malorum">De finibus bonorum et malorum</a></i>, a 1st-century BC Latin text by<a title="Cicero" href="https://en.wikipedia.org/wiki/Cicero">Cicero</a>, with words altered, added, and removed to make it nonsensical, improper<a title="Latin" href="https://en.wikipedia.org/wiki/Latin">Latin</a>.\r\n\r\n<img class="alignnone size-full wp-image-34" src="http://localhost/myproject/aktheme/wp-content/uploads/2018/11/images.png" alt="" width="281" height="180" />\r\n\r\n<a href="http://www.magentocommerce.com/magento-connect/hatimeria-landing-pages.html" target="_blank" rel="nofollow noopener">Hatimeria Landing Pages</a>: Creates landing pages with products using all combinations based on categories, attributes and their values. Description is supplied in the ackend ("lorem ipsum..."). Supports all features like CMS-Block, injecting widgets, blocks, or variables\r\n\r\n<img class="alignnone size-full wp-image-33" src="http://localhost/myproject/aktheme/wp-content/uploads/2018/11/images-5.jpg" alt="" width="201" height="251" />\r\n<h1 id="firstHeading" class="firstHeading" lang="en">Wikipedia:File Upload Wizard</h1>\r\n<div id="bodyContent" class="mw-body-content">\r\n<div id="siteSub" class="noprint">From Wikipedia, the free encyclopedia</div>\r\n<div id="mw-content-text" class="mw-content-ltr" dir="ltr" lang="en">\r\n<div class="mw-parser-output">\r\n<div id="fuwStartScriptLink" class="plainlinks">\r\n\r\nWelcome to the File Upload Wizard. This page is for uploading images and other media files to Wikipedia. When you click the link below, the wizard will guide you through a questionnaire prompting you for the appropriate copyright and sourcing information for each file. Please ensure you understand<a title="Wikipedia:Copyrights" href="https://en.wikipedia.org/wiki/Wikipedia:Copyrights">copyright</a>and the<a title="Wikipedia:Image use policy" href="https://en.wikipedia.org/wiki/Wikipedia:Image_use_policy">image use policy</a>before proceeding.\r\n\r\n<img class="alignnone size-medium wp-image-35" src="http://localhost/myproject/aktheme/wp-content/uploads/2018/11/download-3-300x117.jpg" alt="" width="300" height="117" />\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'Why Us', '', 'publish', 'closed', 'closed', '', 'why-us', '', '', '2018-11-28 07:40:46', '2018-11-28 07:40:46', '', 0, 'http://localhost/myproject/aktheme/?page_id=32', 0, 'page', '', 0),
