INSERT INTO `pages` (`id`, `metak`, `metad`, `pagetitle`, `title`, `subtitle`, `descr`, `img`, `updat`, `status`, `postby`) VALUES
(1, 'Cetpa Net Academy', 'Cetpa Infotech pvt. ltd.', 'No1. Training Company in Roorkee for Java, Cloud, Dot Net, Php, Android, Hardware and Networking', 'About Cetpa Net Academy', '', '<p>CETPA Net Academy is a No.1 training company in Roorkee. CETPA Net Academy is a sister concern of CETPA Infotech Pvt. Ltd.&nbsp; CETPA is a reputed registered Training Company under the company act of 1956 as well as approved by Ministry of Corporate Affairs, Govt of India. CETPA is also certified by ISO 9001:2008. CETPA has spent much time in the field of training, development &amp; consultation; and continuously spread its wing in India as well as in other countries. CETPA is running it&#39;s training center in Roorkee, Dehradun, Noida, Meerut and Lucknow. CETPA is a certified training partner of Microsoft, Oracle, Autodesk, Panasonic and Nuvoton. CETPA has conducted seminars, workshops and on-campus training sessions in more than thousands colleges.<br />\r\nCETPA Net Academy offers several job oriented short term and long term training programs on various technologies like Cloud Computing, Java, Android, .Net, Php, Oracle, Hardware &amp; Networking, SEO etc. CETPA have a excellent team of domain specific certified trainers. CETPA Net Academy is only a place where trainees &quot;learn by doing&quot; under the supervision of experts. Course content deliver by CETPA Net Academy is based on industry trend and demands. If anyone looking for a certified training partner in any technology then CETPA Net Academy is better option because it offers all training program at a very affordable fee similar to an unregistered training company, So this make it differ from other training companies.<br />\r\nCETPA focus on enriched quality training. Well equipped training labs run your practical smoothly and give more hands on experience to you. Trainers at CETPA are certified by its training partners. It&#39;s trainers provide realistic practical on each theoretical concept which build up your skills and make you industry ready. CETPA trainers train you on &quot;Less theory and more practical&quot; concept. Day to day assessments and activity upgrade you to next level competitor to face industry demand.<br />\r\nCETPA Net Academy offers training programs with 100% job assistance. It has a consultation wing which assist aspirants to adopt a specific technology for their career. Placement wing at CETPA helps to find a better career opportunity in selected domain. Due to certified international training partner you gain more job opportunity in MNCs. CETPA is a place where you gain more ROI (return on investment) at a low investment.</p>\r\n', '1504011903ankit.jpg', '14.09.17-03:44:06pm', 'active', 'Admin'),
(2, 'Cetpa Infotech', 'Cetpa Infotech', 'Cetpa Infotech', 'What We Do?', '', '<p>CETPA Net Academy known for his enriched services like training, development, placement and consultation. CETPA is one of the best training company since 2002. CETPA offers on campus training, summer training, winter training, overseas training and many more training programs for engineering students and also for corporate professionals. Our consultation team consult aspirants to select a right domain according to their interest and placement cell assists them to find better opportunities for their career. CETPA also works in the field of development and there are many live projects which are successfully deployed by CETPA development team.</p>\r\n', '', '02.09.17-02:23:53pm', 'active', 'Admin'),
(3, 'Cetpa Infotech', 'Cetpa Infotech', 'Cetpa Infotech', 'Our Team', '', 'We have a energetic team of strategic professionals from different domains to deliver enriched quality services. Our Each and every team member represent the spirit of our company. All the members are dedicated and loyal towards company which make an impressive impact of company in the industry.\r\n', '', '04.09.17-05:44:21pm', 'active', 'Admin'),
(4, NULL, NULL, NULL, 'Management Team', '', 'Management team is backbone of every business. CETPA have a unique team of highly skilled professionals from the domain to plan new strategies and innovative ideas to grow up organization and compete our competitors.  ', '1504353558admin.jpg', '04.09.17-05:56:29pm', 'active', 'Admin'),
(5, NULL, NULL, NULL, 'Marketing Team', '', 'CETPA have a skilled and dynamic team of enthusiastic marketing professionals to plan marketing strategies for business and make a stability in industry. Our marketing team always focus on targeting more audience. ', '1504353604marketing.jpg', '04.09.17-06:50:02pm', 'active', 'Admin'),
(6, NULL, NULL, NULL, 'Training Team', '', '<p>CETPA have a excellent team of well qualified and experienced trainers. Trainers at CETPA are certified by training partners of it. CETPA trainers always focus on <strong>&quot;Less Theory and More Practical&quot;</strong> concept.</p>\r\n', '1504353613training.jpg', '04.09.17-06:57:49pm', 'active', 'Admin'),
(7, NULL, NULL, NULL, 'Placement Team', '', '<p>Placement Team</p>\r\n', '1504353620placement.jpg', '02.09.17-05:36:24pm', 'active', 'Admin');
