(41, 1, '2018-10-10 14:32:56', '2018-10-10 14:32:56', 'Welcome to Education. This is your Education, then start writing!\n\nThere are a lot of opinion regarding the standard of education in INDIA and the efficiency of teaching method in schools today.\n\n<img class="alignnone size-medium wp-image-16" src="http://localhost/Education/wp-content/uploads/2018/10/Education-Blogs-1-300x200.jpg" alt="" width="300" height="200" />\n\nThe Best Education Blog from thousands of top Education podcasts and Educational will be refersed once a week educational blogs in our index using search and social meterics.\n\n<img class="alignnone size-medium wp-image-20" src="http://localhost/Education/wp-content/uploads/2018/10/QBr-1-300x169.gif" alt="" width="300" height="169" />\n\nThey Work with Teacher,Children and schools to bring highly engaging,self-directed learning experiences inside and outside the classroom.\n\nThe educational is an education consulting firm that has its\n\n<img class="alignnone size-medium wp-image-19" src="http://localhost/Education/wp-content/uploads/2018/10/Girls-in-STEM-cropped-GIF-300x186.gif" alt="" width="300" height="186" />\n\n&nbsp;\n\n&nbsp;\n\n<img class="alignnone size-medium wp-image-21" src="http://localhost/Education/wp-content/uploads/2018/10/reniscience-education-blog-pic1-300x177.jpeg" alt="" width="300" height="177" />', 'Hello world!', '', 'inherit', 'closed', 'closed', '', '1-autosave-v1', '', '', '2018-10-10 14:32:56', '2018-10-10 14:32:56', '', 1, 'http://localhost/Education/2018/10/10/1-autosave-v1/', 0, 'revision', '', 0),
(42, 1, '2018-10-10 14:21:52', '2018-10-10 14:21:52', 'Welcome to Education. This is your Education, then start writing!\r\n\r\n<img class="alignnone size-medium wp-image-16" src="http://localhost/Education/wp-content/uploads/2018/10/Education-Blogs-1-300x200.jpg" alt="" width="300" height="200" /> <img class="alignnone size-medium wp-image-15" src="http://localhost/Education/wp-content/uploads/2018/10/CDC_OneConversation_2_Spanish-300x300.gif" alt="" width="300" height="300" /> <img class="alignnone size-medium wp-image-14" src="http://localhost/Education/wp-content/uploads/2018/10/28102016045008425fromstudenttoteacher-300x188.jpg" alt="" width="300" height="188" /> <img class="alignnone size-medium wp-image-20" src="http://localhost/Education/wp-content/uploads/2018/10/QBr-1-300x169.gif" alt="" width="300" height="169" /> <img class="alignnone size-medium wp-image-19" src="http://localhost/Education/wp-content/uploads/2018/10/Girls-in-STEM-cropped-GIF-300x186.gif" alt="" width="300" height="186" /> <img class="alignnone size-medium wp-image-21" src="http://localhost/Education/wp-content/uploads/2018/10/reniscience-education-blog-pic1-300x177.jpeg" alt="" width="300" height="177" />', 'Hello world!', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2018-10-10 14:21:52', '2018-10-10 14:21:52', '', 1, 'http://localhost/Education/2018/10/10/1-revision-v1/', 0, 'revision', '', 0),
(43, 1, '2018-10-10 14:34:08', '2018-10-10 14:34:08', 'Welcome to Education. This is your Education, then start writing!\r\n\r\nThere are a lot of opinion regarding the standard of education in INDIA and the efficiency of teaching method in schools today.\r\n\r\n<img class="alignnone size-medium wp-image-16" src="http://localhost/Education/wp-content/uploads/2018/10/Education-Blogs-1-300x200.jpg" alt="" width="300" height="200" />\r\n\r\nThe Best Education Blog from thousands of top Education podcasts and Educational will be refersed once a week educational blogs in our index using search and social meterics.\r\n\r\n<img class="alignnone size-medium wp-image-20" src="http://localhost/Education/wp-content/uploads/2018/10/QBr-1-300x169.gif" alt="" width="300" height="169" />\r\n\r\nThey Work with Teacher,Children and schools to bring highly engaging,self-directed learning experiences inside and outside the classroom.\r\n\r\nThe educational is an education consulting firm that has its finger on this pulse and is attempting to revolutionise the Indian education system.\r\n\r\n<img class="alignnone size-medium wp-image-19" src="http://localhost/Education/wp-content/uploads/2018/10/Girls-in-STEM-cropped-GIF-300x186.gif" alt="" width="300" height="186" />\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n<img class="alignnone size-medium wp-image-21" src="http://localhost/Education/wp-content/uploads/2018/10/reniscience-education-blog-pic1-300x177.jpeg" alt="" width="300" height="177" />', 'Hello world!', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2018-10-10 14:34:08', '2018-10-10 14:34:08', '', 1, 'http://localhost/Education/2018/10/10/1-revision-v1/', 0, 'revision', '', 0),
