(1, 'ac5269661b', 'Investment Banking', 'javascript:;', 0, 'inSliderboxInvestmentBanking', 'LxIWUOIjdUQ', '<section class="course-carousel-area mt-5">\r\n<div class="container-lg">\r\n<div class="row">\r\n<div class="col">\r\n<h2 class="course-carousel-title">FAQs</h2>\r\n\r\n<div class="course-curriculum-box">\r\n<div class="course-curriculum-accordion">\r\n<div class="lecture-group-wrapper">\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse1" data-toggle="collapse">\r\n<div class="title float-left">Aims our Financial Modelling & Valuations Program</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse1">\r\n<p>With time, the techniques and methodologies followed in the finance domain are also growing and evolving. This is why the concept of Financial models has come up that assists many to understand their business picture and set a benchmark for easy and efficient financial analysis. Thus this course is just a perfect one for you if you aspire to become a finance professional.</p>\r\n\r\n<p>This program is perfect for individuals at every level that includes CFA Charter holders, CAs, MBAs, FRMs, Commerce graduates, and even B. Tech graduates. The course opens the doors for you to learn more about:</p>\r\n\r\n<ul>\r\n <li>-Excel Skills</li>\r\n <li>-Financial Modelling</li>\r\n <li>-Valuations</li>\r\n <li>-Equity Research</li>\r\n <li>-Financial Analysis</li>\r\n <li>-Credit Rating Analysis</li>\r\n <li>-Project Finance</li>\r\n <li>-Deal Structuring</li>\r\n <li>-Derivatives</li>\r\n <li>-Fund Management</li>\r\n</ul>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse2" data-toggle="collapse">\r\n<div class="title float-left">Benefits of the FM Program</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse2">\r\n<ul>\r\n <li>Financial Modelling and Valuations will help you learn to build a comprehensive financial model and compute valuation for a company. It will also assist you to work with historical data on companies and assess the performance of such a company.</li>\r\n <li><br>\r\n With this program, you will learn the art of analysis as a primary input to develop different financial models.</li>\r\n <li><br>\r\n You will also learn how these models predict future financial performances.</li>\r\n</ul>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse3" data-toggle="collapse">\r\n<div class="title float-left">What will I learn in this course?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse3">\r\n<p>You will be learning Basic to Advanced Excel, Financial Statements, Macros, Financial Modelling, Project Financing, Business Valuations, Mergers & Acquisitions and much more. Please refer to the brochures for respective courses.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse4" data-toggle="collapse">\r\n<div class="title float-left">Will this course help me in getting a good job?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse4">\r\n<p>Absolutely ! The course is carefully designed and is led by industry experts to enhance your skills regarding the concepts of corporate finance. Further, our smart learning and practical oriented approach will help you ace that interview.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse5" data-toggle="collapse">\r\n<div class="title float-left">Is this a certification course?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse5">\r\n<p>Yes, a certification will be provided after you pass the evaluation.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse6" data-toggle="collapse">\r\n<div class="title float-left">For how many months, the video access will be provided?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse6">\r\n<p>2-3 months depending upon the course you purchase.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse7" data-toggle="collapse">\r\n<div class="title float-left">Will I be getting any downloadable resources?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse7">\r\n<p>Yes, you will get all the practice files, learning materials, interview tips and questions and much more.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse8" data-toggle="collapse">\r\n<div class="title float-left">How will my doubts get resolved?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse8">\r\n<p>Once you enrol for a course, our instructors are available 24x7 for your support. Also, the live online doubt clearing sessions are held every month.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse9" data-toggle="collapse">\r\n<div class="title float-left">Do I need any prior knowledge before enrolling for the course?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse9">\r\n<p>You just need a basic knowledge of the accounting and finance terminologies. Other than that, our courses are designed in a very easy to understand and comprehensive manner to equip you with all that you need to know.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse10" data-toggle="collapse">\r\n<div class="title float-left">Will I be provided with any placement assistance?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse10">\r\n<p>Yes, we provide 100% placement assistance and also make you interview ready.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse11" data-toggle="collapse">\r\n<div class="title float-left">Will I have any networking opportunities?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse11">\r\n<p>Yes, once you enrol with us, you will be becoming a part of our community of professionals and other students.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 'Investment Banking Courses', 'Investment Banking Courses', 'Best Investment Banking Courses in Delhi NCR, Top Investment Banking Courses in India', 'Advance your career like a professional in investment baning and gain the right knowledge on MS Excel, drafting comprehensive financial modelling and all tricks to study and draft evaluations effectiv', 'Investment Banking Courses, investment banking india, investment banking course with placement, short term finance courses, best institute for financial modelling in delhi, financial analysis course in delhi, best institute for financial modelling course', '', '', NULL, 1558476000, 1607817600, 'fa fa-book'),
(2, 'ac5269661b', 'ACCA', 'javascript:;', 0, 'inSliderboxACCA', 'X_I7v2f3QQo', '<section class="course-carousel-area mt-5">\r\n<div class="container-lg">\r\n<div class="row">\r\n<div class="col">\r\n<h2 class="course-carousel-title">FAQs</h2>\r\n\r\n<div class="course-curriculum-box">\r\n<div class="course-curriculum-accordion">\r\n<div class="lecture-group-wrapper">\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse11" data-toggle="collapse">\r\n<div class="title float-left">What is ACCA and is it good for me?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse11">\r\n<p><strong>ACCA</strong> stands for Association of Chartered Certified Accountants and is a reputed and world renowned association that provides a global qualification for the CAs. The certification includes 13 exams which can be attempted <strong>one by one</strong> depending on your preparation. Further, certain qualifications entitle you to <strong>exemptions</strong> from the 13 papers, over a period of 2436 months. You can comfortably complete it along with college or work, since majority of the training happen only on weekend, 3 year professional work experience and ethic and professional work modules. It is accepted in more than 180 Countries <strong>including India</strong>, and the curriculum is focused on accountancy and finance, putting you on a similar pedestal as that of CA in terms of knowledge and application (barring tax).</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse12" data-toggle="collapse">\r\n<div class="title float-left">What is the scope of ACCA in India and Overseas?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse12">\r\n<p><strong>ACCA</strong> is widely accepted and recognized in India as well as overseas. After completing this prestigious qualification, one can expect a career in the following fields:</p>\r\n\r\n<ol>\r\n <li>Accounting Advisory (IFRS)</li>\r\n <li>Risk Advisory</li>\r\n <li>Mergers & Acquisitions</li>\r\n <li>Valuations</li>\r\n <li>Assurance</li>\r\n <li>Due Diligence</li>\r\n <li>Internal Audit</li>\r\n <li>International Taxation</li>\r\n <li>Transfer Pricing</li>\r\n</ol>\r\n\r\n<p>Companies such as the <strong>Big 4 and various other MNCs</strong>are hiring a huge number of ACCAs in India, at<strong>salary packages</strong>ranging from INR 6 to 8 lacs p.a.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse13" data-toggle="collapse">\r\n<div class="title float-left">Is an ACCA worth doing?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse13">\r\n<p>As a global qualification, the<strong>ACCA</strong>is recognized by employers across the world. If you are looking to take your accounting and finance career to the next level, ACCA is for you.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse1" data-toggle="collapse">\r\n<div class="title float-left">Aims of ACCA Certification</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse1">\r\n<p>ACCA has exclusively become one of the fastest and largest-growing accountancy bodies worldwide with its wings spread in more than 170 countries. This program is drafted to share the detailed accounting skills, knowledge, and professional ethics for professionals in the field of accounting and finance capable of developing successful careers in all business sectors.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse2" data-toggle="collapse">\r\n<div class="title float-left">The Journey of ACCA</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse2">\r\n<ul>\r\n <li><strong>-Stage 1</strong>  Pass 3 Exam Levels\r\n\r\n <table border="1" bordercolor="888888">\r\n  <tbody>\r\n   <tr bgcolor="#Dddddd">\r\n    <th>Levels</th>\r\n    <th>Exams</th>\r\n    <th>Remarks</th>\r\n   </tr>\r\n   <tr>\r\n    <td rowspan="3">Applied Knowledge</td>\r\n    <td>F1 - Accountant in Business (AB)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr bgcolor="#dddddd">\r\n    <td>F2  Management Accountant (MA)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr>\r\n    <td>F3  Financial Accounting (FA)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr bgcolor="#dddddd">\r\n    <td rowspan="6">Applied Skills</td>\r\n    <td>F4  Corporate & Business Law (LW)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr>\r\n    <td>F5  Performance Management (PM)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr>\r\n    <td bgcolor="#dddddd">F6  Taxation (TX)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr>\r\n    <td>F7  Financial Reporting (FR)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr>\r\n    <td bgcolor="#dddddd">F8  Audit & Assurance (AA)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr>\r\n    <td>F9  Financial Management (FM)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr>\r\n    <td rowspan="6">Strategic Professional</td>\r\n    <td bgcolor="#dddddd">Strategic Business Leader (SBL)</td>\r\n    <td bgcolor="#dddddd">Mandatory</td>\r\n   </tr>\r\n   <tr>\r\n    <td>Strategic Business Reporting (SBR)</td>\r\n    <td>Mandatory</td>\r\n   </tr>\r\n   <tr>\r\n    <td bgcolor="#dddddd">Advanced Financial Management (AFM)</td>\r\n    <td bgcolor="#dddddd" rowspan="4">Optional exams  2 exams to be selected out of 4</td>\r\n   </tr>\r\n   <tr>\r\n    <td>Advanced Performance Management (APM)</td>\r\n   </tr>\r\n   <tr bgcolor="#dddddd">\r\n    <td>Advanced Taxation (ATX)</td>\r\n   </tr>\r\n   <tr>\r\n    <td>Advanced Audit & Assurance (AAA)</td>\r\n   </tr>\r\n  </tbody>\r\n </table>\r\n </li>\r\n <li><br>\r\n <strong>-Stage 2 </strong> Practical Experience Requirement:<br>\r\n Obtain 36 months of relevant practical experience under an accounting or finance domain.</li>\r\n <li><br>\r\n <strong>-Stage 3 </strong> Ethics and Professional Skills:<br>\r\n This module is an essential part of ACCA Qualification and helps to increase your employability and workplace effectiveness. It is an online training module which uses realistic business simulations to develop an important professional skill such as leadership, communication and commercial awareness.</li>\r\n</ul>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse3" data-toggle="collapse">\r\n<div class="title float-left">Exemptions available</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse3">\r\n<table border="1" bordercolor="888888">\r\n <tbody>\r\n  <tr bgcolor="#Dddddd">\r\n   <th>Qualification</th>\r\n   <th>No. of exams to give</th>\r\n   <th>Exemption available</th>\r\n  </tr>\r\n  <tr>\r\n   <td>12th Pass</td>\r\n   <td>13 exams</td>\r\n   <td>No exemption available</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <td>Graduate</td>\r\n   <td>9 exams</td>\r\n   <td>4 exemptions (F1  F4)</td>\r\n  </tr>\r\n  <tr>\r\n   <td>Passed intermediate level of CA exams</td>\r\n   <td>7 exams</td>\r\n   <td>6 exemptions (F1-F4, F6, F8)</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <td>Partial completion of CA Final exams</td>\r\n   <td>4  6 exams</td>\r\n   <td>7  9 exemptions (up to F9)</td>\r\n  </tr>\r\n  <tr>\r\n   <td>Chartered Accountant</td>\r\n   <td>4 exams</td>\r\n   <td>9 exemptions (F1  F9)</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <td>Masters degree</td>\r\n   <td>9 exams</td>\r\n   <td>4 Exemptions (F1  F4)</td>\r\n  </tr>\r\n </tbody>\r\n</table>\r\n\r\n<p class="alignJustify mb-5"><br>\r\nCalculate your Exemptions - <a href="https://www.accaglobal.com/an/en/help/exemptions-calculator.html">https://www.accaglobal.com/an/en/help/exemptions-calculator.html</a></p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse4" data-toggle="collapse">\r\n<div class="title float-left">Cost Structure</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse4">\r\n<table border="1" bordercolor="888888">\r\n <tbody>\r\n  <tr bgcolor="#Dddddd">\r\n   <th>Particulars</th>\r\n   <th>Amount (GBP)</th>\r\n   <th>Amount (INR)(using average rate of 95)</th>\r\n  </tr>\r\n  <tr>\r\n   <td>Initial registration</td>\r\n   <td>GBP 79</td>\r\n   <td>INR 7,505</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <td>Annual subscription fee</td>\r\n   <td>GBP 112</td>\r\n   <td>INR 10,640</td>\r\n  </tr>\r\n  <tr>\r\n   <td>Knowledge level exams</td>\r\n   <td>GBP 240 (80 * 3)</td>\r\n   <td>INR 22,800</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <td>Skills level exams</td>\r\n   <td>GBP 720 (120 * 6)</td>\r\n   <td>INR 68,400</td>\r\n  </tr>\r\n  <tr>\r\n   <td>Professional level exams</td>\r\n   <td>GBP 687 (219 + 156 * 3)</td>\r\n   <td>INR 65,265</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <th>Total cost</th>\r\n   <th>GBP 1,230</th>\r\n   <th>INR 1,74,610</th>\r\n  </tr>\r\n </tbody>\r\n</table>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse5" data-toggle="collapse">\r\n<div class="title float-left">Bonus degrees along with ACCA</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse5">\r\n<ul>\r\n <li><strong>-BSc Degree in Applied Accounting from Oxford Brookes University. </strong> Please visit <a href="https://www.accaglobal.com/hk/en/student/exam-entry-and-administration/oxford-brookes-bsc-hons-in-applied-accounting/eligibility-for-the-oxford-brookesbsc.html" target="_blank">https://www.accaglobal.com/hk/en/student/exam-entry-and-administration/oxford-brookes-bsc-hons-in-applied-accounting/eligibility-for-the-oxford-brookesbsc.html</a><br>\r\n </li>\r\n <li><strong>-Masters in Professional Accountancy from University of London: </strong> <a href="https://www.accaglobal.com/lk/en/qualifications/glance/university-of-london-uol-msc-in-professional-accountancy/uol-msc-professional-accountancy-overview.html" target="_blank">https://www.accaglobal.com/lk/en/qualifications/glance/university-of-london-uol-msc-in-professional-accountancy/uol-msc-professional-accountancy-overview.html</a></li>\r\n</ul>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse6" data-toggle="collapse">\r\n<div class="title float-left">Benefits of the ACCA Program</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse6">\r\n<ul>\r\n <li>-You will have a highly qualified and certified faculty at your desk to help you with extensive tutoring and guidance.You will have a highly qualified and certified faculty at your desk to help you with extensive tutoring and guidance.</li>\r\n <li>-You will have a highly qualified and certified faculty at your desk to help you with extensive tutoring and guidance.You will be benefited from intensive practical training and understanding of the respective field of study.</li>\r\n <li>-With strong industry links, you will surely be getting excellent placement opportunities for yourself as well.With strong industry links, you will surely be getting excellent placement opportunities for yourself as well.</li>\r\n</ul>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse14" data-toggle="collapse">\r\n<div class="title float-left">CA v/s ACCA</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse14">\r\n<table border="1" bordercolor="888888">\r\n <tbody>\r\n  <tr bgcolor="#Dddddd">\r\n   <th></th>\r\n   <th>CA</th>\r\n   <th>ACCA</th>\r\n  </tr>\r\n  <tr>\r\n   <th>Institution</th>\r\n   <td>Institution of Chartered accountant of India (ICAI)</td>\r\n   <td>Association of Chartered Certified Accountant (ACCA)</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <th>Duration</th>\r\n   <td>4-5 Years</td>\r\n   <td>1-2 year (depending upon exemptions)</td>\r\n  </tr>\r\n  <tr>\r\n   <th>Exam Patterns</th>\r\n   <td>16 exam papers</td>\r\n   <td>13 exams (up to 9 exemptions available)</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <th>Mode of Exams</th>\r\n   <td>Offline</td>\r\n   <td>Online</td>\r\n  </tr>\r\n  <tr>\r\n   <th>Accounting Standards</th>\r\n   <td>Ind-AS</td>\r\n   <td>IFRS</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <th>Recognition</th>\r\n   <td>India, Middle East</td>\r\n   <td>Globally</td>\r\n  </tr>\r\n  <tr>\r\n   <th>Pass percentage</th>\r\n   <td>7%-20%</td>\r\n   <td>50%</td>\r\n  </tr>\r\n </tbody>\r\n</table>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse15" data-toggle="collapse">\r\n<div class="title float-left">Is ACCA better than MBA?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse15">\r\n<p>ACCA is a professional qualification and enjoys a premium recognition globally while MBA has a cutthroat competition with the higher packages limited to the top tier universities. Also, MBA in India, from a top tier university is much more expensive than ACCA. Further, ACCA can be accomplished along with other certifications or can be pursued along with your Job, while MBA is a full time regular program.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse16" data-toggle="collapse">\r\n<div class="title float-left">How many papers I can sit for in one year?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse16">\r\n<p>TheACCAexams are conducted in four sittings across theyear. Students are allowed to take up to eightACCApapers withinone year. Withinoneexam sitting, a studentcanonly take fourACCApapers.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse17" data-toggle="collapse">\r\n<div class="title float-left">For how long I can assess the videos?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse17">\r\n<p>Recorded lectures are normally available for one exam sitting but if for some reason the student is not able to sit in that sitting or unable to clear it then the recordings are extended.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse18" data-toggle="collapse">\r\n<div class="title float-left">How will I clear my doubts?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse18">\r\n<p>You will get the 24*7 support from the tutors and from time to time doubt clearing sessions are conducted to have live interaction.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 'ACCA Courses', 'ACCA Courses', 'Best ACCA Course in Delhi NCR', 'Enroll in the Association of Chartered Certified Accountants course and grab the right knowledge required for analytical thinking & decision-making skills that every top global employer looks for in t', 'ACCA Course in Delhi, Best ACCA institute in Delhi NCR, Top institute for ACCA in India, ACCA course fees in Delhi, ACCA course fees in Delhi NCR, Best ACCA tutor in Delhi NCR, Best ACCA institute in Delhi with placement', '', '', NULL, 1558476000, 1607817600, 'fa fa-dollar'),
(3, 'ac5269661b', 'CFA', 'javascript:;', 0, 'inSliderboxCFA', 'q5JWp47z4bY', '<section class="course-carousel-area mt-5">\r\n<div class="container-lg">\r\n<div class="row">\r\n<div class="col">\r\n<section class="testimonial-carousel-area course-carousel-area aboutSection">\r\n<section class="about" id="about">\r\n<div class="container">\r\n<div class="row animatedParent">\r\n<div class="col-lg-12"><img alt="about-afrr" class="img-fluid animated bounceInDown" src="https://demo.techonika.com/lmscreatr/uploads/launchingsoon.jpg" xss=removed xss="removed"></div>\r\n</div>\r\n</div>\r\n</section>\r\n</section>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 'CFA Courses', 'CFA Courses', 'CFA Courses', 'CFA Courses', 'CFA Courses', NULL, NULL, NULL, 1558476000, 1603080000, 'fa fa-address-card'),
(8, '7d44841df3', 'Investment Banking Courses', 'investment-banking', 1, 'inSliderboxInvestmentBanking', 'LxIWUOIjdUQ', '<section class="course-carousel-area mt-5">\r\n<div class="container-lg">\r\n<div class="row">\r\n<div class="col">\r\n<h2 class="course-carousel-title">FAQs</h2>\r\n\r\n<div class="course-curriculum-box">\r\n<div class="course-curriculum-accordion">\r\n<div class="lecture-group-wrapper">\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse1" data-toggle="collapse">\r\n<div class="title float-left">Aims our Financial Modelling & Valuations Program</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse1">\r\n<p>With time, the techniques and methodologies followed in the finance domain are also growing and evolving. This is why the concept of Financial models has come up that assists many to understand their business picture and set a benchmark for easy and efficient financial analysis. Thus this course is just a perfect one for you if you aspire to become a finance professional.</p>\r\n\r\n<p>This program is perfect for individuals at every level that includes CFA Charter holders, CAs, MBAs, FRMs, Commerce graduates, and even B. Tech graduates. The course opens the doors for you to learn more about:</p>\r\n\r\n<ul>\r\n <li>-Excel Skills</li>\r\n <li>-Financial Modelling</li>\r\n <li>-Valuations</li>\r\n <li>-Equity Research</li>\r\n <li>-Financial Analysis</li>\r\n <li>-Credit Rating Analysis</li>\r\n <li>-Project Finance</li>\r\n <li>-Deal Structuring</li>\r\n <li>-Derivatives</li>\r\n <li>-Fund Management</li>\r\n</ul>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse2" data-toggle="collapse">\r\n<div class="title float-left">Benefits of the FM Program</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse2">\r\n<ul>\r\n <li>Financial Modelling and Valuations will help you learn to build a comprehensive financial model and compute valuation for a company. It will also assist you to work with historical data on companies and assess the performance of such a company.</li>\r\n <li><br>\r\n With this program, you will learn the art of analysis as a primary input to develop different financial models.</li>\r\n <li><br>\r\n You will also learn how these models predict future financial performances.</li>\r\n</ul>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse3" data-toggle="collapse">\r\n<div class="title float-left">What will I learn in this course?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse3">\r\n<p>You will be learning Basic to Advanced Excel, Financial Statements, Macros, Financial Modelling, Project Financing, Business Valuations, Mergers & Acquisitions and much more. Please refer to the brochures for respective courses.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse4" data-toggle="collapse">\r\n<div class="title float-left">Will this course help me in getting a good job?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse4">\r\n<p>Absolutely ! The course is carefully designed and is led by industry experts to enhance your skills regarding the concepts of corporate finance. Further, our smart learning and practical oriented approach will help you ace that interview.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse5" data-toggle="collapse">\r\n<div class="title float-left">Is this a certification course?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse5">\r\n<p>Yes, a certification will be provided after you pass the evaluation.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse6" data-toggle="collapse">\r\n<div class="title float-left">For how many months, the video access will be provided?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse6">\r\n<p>2-3 months depending upon the course you purchase.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse7" data-toggle="collapse">\r\n<div class="title float-left">Will I be getting any downloadable resources?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse7">\r\n<p>Yes, you will get all the practice files, learning materials, interview tips and questions and much more.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse8" data-toggle="collapse">\r\n<div class="title float-left">How will my doubts get resolved?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse8">\r\n<p>Once you enrol for a course, our instructors are available 24x7 for your support. Also, the live online doubt clearing sessions are held every month.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse9" data-toggle="collapse">\r\n<div class="title float-left">Do I need any prior knowledge before enrolling for the course?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse9">\r\n<p>You just need a basic knowledge of the accounting and finance terminologies. Other than that, our courses are designed in a very easy to understand and comprehensive manner to equip you with all that you need to know.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse10" data-toggle="collapse">\r\n<div class="title float-left">Will I be provided with any placement assistance?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse10">\r\n<p>Yes, we provide 100% placement assistance and also make you interview ready. </p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse11" data-toggle="collapse">\r\n<div class="title float-left">Will I have any networking opportunities?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse11">\r\n<p>Yes, once you enrol with us, you will be becoming a part of our community of professionals and other students. </p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 'Investment Banking Courses', 'Investment Banking Courses', 'Investment Banking Courses', 'Investment Banking Courses', 'Investment Banking Courses', NULL, NULL, NULL, 1603080000, 1603080000, NULL),
(9, '569ed551df', 'ACCA Program', 'acca', 2, 'inSliderboxACCA', 'X_I7v2f3QQo', '<section class="course-carousel-area mt-5">\r\n<div class="container-lg">\r\n<div class="row">\r\n<div class="col">\r\n<h2 class="course-carousel-title">FAQs</h2>\r\n\r\n<div class="course-curriculum-box">\r\n<div class="course-curriculum-accordion">\r\n<div class="lecture-group-wrapper">\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse11" data-toggle="collapse">\r\n<div class="title float-left">What is ACCA and is it good for me?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse11">\r\n<p><strong>ACCA</strong> stands for Association of Chartered Certified Accountants and is a reputed and world renowned association that provides a global qualification for the CAs. The certification includes 13 exams which can be attempted <strong>one by one</strong> depending on your preparation. Further, certain qualifications entitle you to <strong>exemptions</strong> from the 13 papers, over a period of 2436 months. You can comfortably complete it along with college or work, since majority of the training happen only on weekend, 3 year professional work experience and ethic and professional work modules. It is accepted in more than 180 Countries <strong>including India</strong>, and the curriculum is focused on accountancy and finance, putting you on a similar pedestal as that of CA in terms of knowledge and application (barring tax).</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse12" data-toggle="collapse">\r\n<div class="title float-left">What is the scope of ACCA in India and Overseas?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse12">\r\n<p><strong>ACCA</strong> is widely accepted and recognized in India as well as overseas. After completing this prestigious qualification, one can expect a career in the following fields:</p>\r\n\r\n<ol>\r\n <li>Accounting Advisory (IFRS)</li>\r\n <li>Risk Advisory</li>\r\n <li>Mergers & Acquisitions</li>\r\n <li>Valuations</li>\r\n <li>Assurance</li>\r\n <li>Due Diligence</li>\r\n <li>Internal Audit</li>\r\n <li>International Taxation</li>\r\n <li>Transfer Pricing</li> \r\n</ol>\r\n<p>Companies such as the <strong>Big 4 and various other MNCs</strong>are hiring a huge number of ACCAs in India, at<strong>salary packages</strong>ranging from INR 6 to 8 lacs p.a.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse13" data-toggle="collapse">\r\n<div class="title float-left">Is an ACCA worth doing?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse13">\r\n<p>As a global qualification, the<strong>ACCA</strong>is recognized by employers across the world. If you are looking to take your accounting and finance career to the next level, ACCA is for you.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse1" data-toggle="collapse">\r\n<div class="title float-left">Aims of ACCA Certification</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse1">\r\n<p>ACCA has exclusively become one of the fastest and largest-growing accountancy bodies worldwide with its wings spread in more than 170 countries. This program is drafted to share the detailed accounting skills, knowledge, and professional ethics for professionals in the field of accounting and finance capable of developing successful careers in all business sectors.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse2" data-toggle="collapse">\r\n<div class="title float-left">The Journey of ACCA</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse2">\r\n<ul>\r\n <li><strong>-Stage 1</strong>  Pass 3 Exam Levels\r\n\r\n <table border="1" bordercolor="888888">\r\n  <tbody>\r\n   <tr bgcolor="#Dddddd">\r\n    <th>Levels</th>\r\n    <th>Exams</th>\r\n    <th>Remarks</th>\r\n   </tr>\r\n   <tr>\r\n    <td rowspan="3">Applied Knowledge</td>\r\n    <td>F1 - Accountant in Business (AB)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr bgcolor="#dddddd">\r\n    <td>F2  Management Accountant (MA)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr>\r\n    <td>F3  Financial Accounting (FA)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr bgcolor="#dddddd">\r\n    <td rowspan="6">Applied Skills</td>\r\n    <td>F4  Corporate & Business Law (LW)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr>\r\n    <td>F5  Performance Management (PM)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr>\r\n    <td bgcolor="#dddddd">F6  Taxation (TX)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr>\r\n    <td>F7  Financial Reporting (FR)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr>\r\n    <td bgcolor="#dddddd">F8  Audit & Assurance (AA)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr>\r\n    <td>F9  Financial Management (FM)</td>\r\n    <td>Exemption available</td>\r\n   </tr>\r\n   <tr>\r\n    <td rowspan="6">Strategic Professional</td>\r\n    <td bgcolor="#dddddd">Strategic Business Leader (SBL)</td>\r\n    <td bgcolor="#dddddd">Mandatory</td>\r\n   </tr>\r\n   <tr>\r\n    <td>Strategic Business Reporting (SBR)</td>\r\n    <td>Mandatory</td>\r\n   </tr>\r\n   <tr>\r\n    <td bgcolor="#dddddd">Advanced Financial Management (AFM)</td>\r\n    <td bgcolor="#dddddd" rowspan="4">Optional exams  2 exams to be selected out of 4</td>\r\n   </tr>\r\n   <tr>\r\n    <td>Advanced Performance Management (APM)</td>\r\n   </tr>\r\n   <tr bgcolor="#dddddd">\r\n    <td>Advanced Taxation (ATX)</td>\r\n   </tr>\r\n   <tr>\r\n    <td>Advanced Audit & Assurance (AAA)</td>\r\n   </tr>\r\n  </tbody>\r\n </table>\r\n </li>\r\n <li><br>\r\n <strong>-Stage 2 </strong> Practical Experience Requirement:<br>\r\n Obtain 36 months of relevant practical experience under an accounting or finance domain.</li>\r\n <li><br>\r\n <strong>-Stage 3 </strong> Ethics and Professional Skills:<br>\r\n This module is an essential part of ACCA Qualification and helps to increase your employability and workplace effectiveness. It is an online training module which uses realistic business simulations to develop an important professional skill such as leadership, communication and commercial awareness.</li>\r\n</ul>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse3" data-toggle="collapse">\r\n<div class="title float-left">Exemptions available</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse3">\r\n<table border="1" bordercolor="888888">\r\n <tbody>\r\n  <tr bgcolor="#Dddddd">\r\n   <th>Qualification</th>\r\n   <th>No. of exams to give</th>\r\n   <th>Exemption available</th>\r\n  </tr>\r\n  <tr>\r\n   <td>12th Pass</td>\r\n   <td>13 exams</td>\r\n   <td>No exemption available</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <td>Graduate</td>\r\n   <td>9 exams</td>\r\n   <td>4 exemptions (F1  F4)</td>\r\n  </tr>\r\n  <tr>\r\n   <td>Passed intermediate level of CA exams</td>\r\n   <td>7 exams</td>\r\n   <td>6 exemptions (F1-F4, F6, F8)</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <td>Partial completion of CA Final exams</td>\r\n   <td>4  6 exams</td>\r\n   <td>7  9 exemptions (up to F9)</td>\r\n  </tr>\r\n  <tr>\r\n   <td>Chartered Accountant</td>\r\n   <td>4 exams</td>\r\n   <td>9 exemptions (F1  F9)</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <td>Masters degree</td>\r\n   <td>9 exams</td>\r\n   <td>4 Exemptions (F1  F4)</td>\r\n  </tr>\r\n </tbody>\r\n</table>\r\n\r\n<p class="alignJustify mb-5"><br>\r\nCalculate your Exemptions - <a href="https://www.accaglobal.com/an/en/help/exemptions-calculator.html">https://www.accaglobal.com/an/en/help/exemptions-calculator.html</a></p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse4" data-toggle="collapse">\r\n<div class="title float-left">Cost Structure</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse4">\r\n<table border="1" bordercolor="888888">\r\n <tbody>\r\n  <tr bgcolor="#Dddddd">\r\n   <th>Particulars</th>\r\n   <th>Amount (GBP)</th>\r\n   <th>Amount (INR)(using average rate of 95)</th>\r\n  </tr>\r\n  <tr>\r\n   <td>Initial registration</td>\r\n   <td>GBP 79</td>\r\n   <td>INR 7,505</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <td>Annual subscription fee</td>\r\n   <td>GBP 112</td>\r\n   <td>INR 10,640</td>\r\n  </tr>\r\n  <tr>\r\n   <td>Knowledge level exams</td>\r\n   <td>GBP 240 (80 * 3)</td>\r\n   <td>INR 22,800</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <td>Skills level exams</td>\r\n   <td>GBP 720 (120 * 6)</td>\r\n   <td>INR 68,400</td>\r\n  </tr>\r\n  <tr>\r\n   <td>Professional level exams</td>\r\n   <td>GBP 687 (219 + 156 * 3)</td>\r\n   <td>INR 65,265</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <th>Total cost</th>\r\n   <th>GBP 1,230</th>\r\n   <th>INR 1,74,610</th>\r\n  </tr>\r\n </tbody>\r\n</table>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse5" data-toggle="collapse">\r\n<div class="title float-left">Bonus degrees along with ACCA</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse5">\r\n<ul>\r\n <li><strong>-BSc Degree in Applied Accounting from Oxford Brookes University. </strong> Please visit <a href="https://www.accaglobal.com/hk/en/student/exam-entry-and-administration/oxford-brookes-bsc-hons-in-applied-accounting/eligibility-for-the-oxford-brookesbsc.html" target="_blank">https://www.accaglobal.com/hk/en/student/exam-entry-and-administration/oxford-brookes-bsc-hons-in-applied-accounting/eligibility-for-the-oxford-brookesbsc.html</a><br>\r\n </li>\r\n <li><strong>-Masters in Professional Accountancy from University of London: </strong> <a href="https://www.accaglobal.com/lk/en/qualifications/glance/university-of-london-uol-msc-in-professional-accountancy/uol-msc-professional-accountancy-overview.html" target="_blank">https://www.accaglobal.com/lk/en/qualifications/glance/university-of-london-uol-msc-in-professional-accountancy/uol-msc-professional-accountancy-overview.html</a></li>\r\n</ul>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse6" data-toggle="collapse">\r\n<div class="title float-left">Benefits of the ACCA Program</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse6">\r\n<ul>\r\n <li>-You will have a highly qualified and certified faculty at your desk to help you with extensive tutoring and guidance.You will have a highly qualified and certified faculty at your desk to help you with extensive tutoring and guidance.</li>\r\n <li>-You will have a highly qualified and certified faculty at your desk to help you with extensive tutoring and guidance.You will be benefited from intensive practical training and understanding of the respective field of study.</li>\r\n <li>-With strong industry links, you will surely be getting excellent placement opportunities for yourself as well.With strong industry links, you will surely be getting excellent placement opportunities for yourself as well.</li>\r\n</ul>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse14" data-toggle="collapse">\r\n<div class="title float-left">CA v/s ACCA</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse14">\r\n<table border="1" bordercolor="888888">\r\n <tbody>\r\n  <tr bgcolor="#Dddddd">\r\n   <th></th>\r\n   <th>CA</th>\r\n   <th>ACCA</th>\r\n  </tr>\r\n  <tr>\r\n   <th>Institution</th>\r\n   <td>Institution of Chartered accountant of India (ICAI)</td>\r\n   <td>Association of Chartered Certified Accountant (ACCA)</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <th>Duration </th>\r\n   <td>4-5 Years </td>\r\n   <td>1-2 year (depending upon exemptions)</td>\r\n  </tr>\r\n  <tr>\r\n   <th>Exam Patterns </th>\r\n   <td>16 exam papers </td>\r\n   <td>13 exams (up to 9 exemptions available)</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <th>Mode of Exams</th>\r\n   <td>Offline </td>\r\n   <td>Online</td>\r\n  </tr>\r\n  <tr>\r\n   <th>Accounting Standards</th>\r\n   <td>Ind-AS </td>\r\n   <td>IFRS</td>\r\n  </tr>\r\n  <tr bgcolor="#Dddddd">\r\n   <th>Recognition</th>\r\n   <td>India, Middle East </td>\r\n   <td>Globally </td>\r\n  </tr>\r\n<tr>\r\n   <th>Pass percentage </th>\r\n   <td>7%-20%</td>\r\n   <td>50%</td>\r\n  </tr>\r\n </tbody>\r\n</table>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse15" data-toggle="collapse">\r\n<div class="title float-left">Is ACCA better than MBA?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse15">\r\n<p>ACCA is a professional qualification and enjoys a premium recognition globally while MBA has a cutthroat competition with the higher packages limited to the top tier universities. Also, MBA in India, from a top tier university is much more expensive than ACCA. Further, ACCA can be accomplished along with other certifications or can be pursued along with your Job, while MBA is a full time regular program.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse16" data-toggle="collapse">\r\n<div class="title float-left">How many papers I can sit for in one year?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse16">\r\n<p>TheACCAexams are conducted in four sittings across theyear. Students are allowed to take up to eightACCApapers withinone year. Withinoneexam sitting, a studentcanonly take fourACCApapers.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse17" data-toggle="collapse">\r\n<div class="title float-left">For how long I can assess the videos?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse17">\r\n<p>Recorded lectures are normally available for one exam sitting but if for some reason the student is not able to sit in that sitting or unable to clear it then the recordings are extended.</p>\r\n</div>\r\n\r\n<div aria-expanded="false" class="lecture-group-title clearfix" data-target="#collapse18" data-toggle="collapse">\r\n<div class="title float-left">How will I clear my doubts?</div>\r\n</div>\r\n\r\n<div class="lecture-list collapse accordiText" id="collapse18">\r\n<p>You will get the 24*7 support from the tutors and from time to time doubt clearing sessions are conducted to have live interaction.</p>\r\n</div>\r\n\r\n\r\n</div>\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 'ACCA Courses', 'ACCA Courses', 'ACCA Courses', 'ACCA Courses', 'ACCA Courses', NULL, NULL, NULL, 1603080000, 1603080000, NULL),
(10, '297a463ade', 'CFA Program', 'cfa', 3, 'inSliderboxCFA', 'q5JWp47z4bY', '<section class="course-carousel-area mt-5">\r\n<div class="container-lg">\r\n<div class="row">\r\n<div class="col">\r\n<section class="testimonial-carousel-area course-carousel-area aboutSection">\r\n<section class="about" id="about">\r\n<div class="container">\r\n<div class="row animatedParent">\r\n<div class="col-lg-12"><img alt="about-afrr" class="img-fluid animated bounceInDown" src="https://demo.techonika.com/lmscreatr/uploads/launchingsoon.jpg" xss=removed xss="removed"></div>\r\n</div>\r\n</div>\r\n</section>\r\n</section>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 'CFA Courses', 'CFA Courses', 'CFA Courses', 'CFA Courses', 'CFA Courses', NULL, NULL, NULL, 1603080000, 1603080000, NULL);
