(1, 'Vivek Atukuri', 'vivekvarmaatukuri@gmail.com', '9966445623', 'Financial Modelling & Valuation', 'Hi team,\r\n\r\nI am interested in the above mentioned program and would like to know in detail more about the structure and how it works.', 1, '2020-11-03 19:47:30', '2020-11-03 14:17:30'),
(2, 'Vaishali Ahuja', 'vaishaliahuja9@gmail.com', '8053011352', 'QUERY RELATED TO FINANCIAL MODELLING JOB', 'Respected sir/ma''am\r\nI, Vaishali Ahuja is doing MBA in Finance and business analytics, along with that i am pursuing Financial modelling course also. I want to ask something related to this FM course.\r\nPlease contact me if you get my message.\r\n\r\nYours sincerely\r\nVaishali Ahuja', 1, '2020-12-08 01:41:49', '2020-12-07 20:11:49');
