INSERT INTO `frontend_settings` (`id`, `key`, `value`) VALUES
(1, 'banner_title', 'Our Experience, Your Enrichment'),
(2, 'banner_sub_title', ''),
(3, 'about_us', '<section class="testimonial-carousel-area course-carousel-area founderMessage"><div class="container-lg"><div class="row"><div class="col"><div class="testimonials"><div class="test-body animatedParent"><div class="item animated growIn box"><img src="https://demo.techonika.com/lmscreatr/uploads/mission.png"><div class="name">Our Mission</div><div align="center"><p><i><strong>- A team that pushes you ahead in cutthroat competition with its experience!</strong></i></p></div><div align="justify"><p>We work with a prime motive of providing progressive yet convenient training programs that enhance your learning experience. We are continuously improving in providing our courses in an engaging environment. Our team will ensure that all the bases are covered to help you dominate in this competitive market.</p></div></div><div class="item animated growIn box"><img src="https://demo.techonika.com/lmscreatr/uploads/vision.png"><div class="name">Our Vision</div><div align="center"><p><i><strong>-A better learning opportunity is all that we have for all in our vision!</strong></i></p></div><div align="justify"><p>To be the best in the business, we work with a vision of continuous improvements. We understand your learning pattern and customize the course accordingly. Whether you desire to pursue Chartered financial analyst programs or excel online courses, the programs will be designed that fit your convenience.</p></div></div></div></div></div></div></div></section><section class="testimonial-carousel-area course-carousel-area aboutSection"><section class="about" id="about"><div class="container"><div class="row animatedParent"><div class="col-lg-6"><img alt="about-afrr" class="img-fluid animated bounceInDown" src="https://demo.techonika.com/lmscreatr/uploads/about-afrr.jpg" width="100%"></div><div class="col-lg-6 animated bounceInRight slow go"><div align="center"><h3>A Few Words About Us</h3></div><div align="justify"><p>Created by highly qualified professionals, AR Finance Room works with the motive of helping students and professionals learn and grow with customized courses.</p><p>We have the right approach and facilities to help you get prepared for International Professional Certifications. You can always trust our team for excellent results in CFA and ACCA plus our Financial Modelling & Valuations course helps you to get an edge over your competition for an exciting career in Corporate Finance.</p><p>You can reach out to us for extensive ACCA online courses, CFA programs, Investment Banking courses, and Excel training. We have our wings spread to all corners of the world including India, Dubai, Canada, France, Sri Lanka, Nepal, USA, UK, Pakistan, Bangladesh, and many other countries.</p></div></div></div></div></section></section><section class="testimonial-carousel-area course-carousel-area founderMessage"><div class="container-lg"><div class="row"><div class="col"><h2 class="course-carousel-title">Our Team</h2><div align="center"><p><i>- A team that pushes you ahead in cutthroat competition with its experience!</i></p></div><div align="justify"><p>Industry experts are here to serve you with excellent guidance throughout your course of study. Our team is full of enthusiastic and passionate tutors who belong to different professional sectors. The prime focus of our team has always been to get you job-ready through deep insights into your subject and corporate ethics.</p></div><div class="testimonials"><div class="test-body animatedParent"><div class="item animated growIn box"><img src="https://demo.techonika.com/lmscreatr//uploads/ayush111.jpg" xss="removed"><div class="name">Aayush Bajaj</div><small class="desig">Founder</small><div align="justify"><p>Aayush is an international level corporate trainer for Financial Modelling, Valuations, CPA and ACCA.</p><p>Aayush is a Certified Public Accountant (CPA), United States. He further holds a Masters degree and a Bachelors degree in Commerce from Delhi University.</p><p>Prior to LMS Creatr, Aayush was associated with EY India for 3 years in their Valuations and Business Modelling department and with KPMG for 2 years in their audit department.</p></div></div><div class="item animated growIn box"><img src="https://demo.techonika.com/lmscreatr//uploads/rahul111.jpg" xss="removed"><div class="name">Rahul Talwar</div><small class="desig">Co-Founder</small><div align="justify"><p>Rahul is a National Trainer for Excel, Financial Modelling and ACCA as well as a career counsellor to a lot of students pan India.</p><p>Rahul is associated with ACCA from past 5 years and holds a bachelor degree in Accounting and Finance from Oxford Brooks University, London.</p><p>In his previous stints prior to LMS Creatr he was associated with Deloitte UK in Audit department, Wilson Associates in Finance Department and SGS Infra in Finance Department.</p></div></div></div></div></div></div></div></section><section class="testimonial-carousel-area course-carousel-area aboutSection"><section class="about" id="about"><div class="container"><div class="row animatedParent"><div class="col-lg-6 col-lg-6 animated bounceInRight slow go"><div align="center"><h3>Why Choose Us?</h3></div><div align="justify"><p><strong>Accommodating your learning needs as per your convenience makes us your partner in growth!</strong></p><p>We have the best in-house certified professionals to guide you through factual learning, corporate culture, and practical projects. From CFA to ACCA online courses, every single program will be designed after listening to your requirements carefully!</p><p>Whether you need on-site classes or online training, we have all in our bucket to serve you! So, keep the fear aside and join the team of experts to nail your examinations!</p></div></div><div class="col-lg-6 animated bounceInRight slow go"><img alt="about-afrr" class="img-fluid animated bounceInDown" src="https://demo.techonika.com/lmscreatr/uploads/why-afrr.jpg" width="100%"></div></div></div></section></section>'),
(4, 'terms_and_condition', '<div align="center"><h1>Terms Of Use</h1></div><div align="center"><b>Last updated September 2020</b>  </div><div></div><div align="center"><b>AGREEMENT TO TERMS</b> </div><div align="justify"><span>These Terms of Use constitute alegally binding agreement made between you, whether personally or on behalf ofan entity (you) and Teachbox Learning & Development LLP, doing businessas AR Finance Room ("<b>ARFR</b>", <b>we</b>, <b>us</b>, or <b>our</b>),concerning your access to and use of the <a href="https://demo.techonika.com/lms/" target="" rel="">www.techonika.com</a> website as wellas any other media form, media channel, mobile website, or mobile applicationrelated, linked, or otherwise connected thereto (collectively, the Site). Youagree that by accessing the Site, you have read, understood, and agreed to bebound by all of these Terms of Use. IF YOU DO NOT AGREE WITH ALL OF THESE TERMSOF USE, THEN YOU ARE EXPRESSLY PROHIBITED FROM USING THE SITE AND YOU MUSTDISCONTINUE USE IMMEDIATELY.</span></div><div align="justify">Supplemental terms and conditions or documents that may be posted on the Site from time to time are hereby expressly incorporated herein by reference. We reserve the right, in our sole discretion, to make changes or modifications to these Terms of Use at any time and for any reason. We will alert you about any changes by updating the Last updated date of these Terms of Use, and you waive any right to receive specific notice of each such change. It is your responsibility to periodically review these Terms of Use to stay informed of updates. You will be subject to, and will be deemed to have been made aware of and to have accepted, the changes in any revised Terms of Use by your continued use of the Site after the date such revised Terms of Use are posted.</div><div align="justify">The information provided on the Site is not intended for distribution to or use by any person or entity in any jurisdiction or country where such distribution or use would be contrary to law or regulation or which would subject us to any registration requirement within such jurisdiction or country. Accordingly, those persons who choose to access the Site from other locations do so on their own initiative and are solely responsible for compliance with local laws, if and to the extent local laws are applicable. </div><div align="justify">The Site is not tailored to comply with industry-specific regulations (Health Insurance Portability and Accountability Act (HIPAA), Federal Information Security Management Act (FISMA), etc.), so if your interactions would be subjected to such laws, you may not use this Site. You may not use the Site in a way that would violate the Gramm-Leach-Bliley Act (GLBA). </div><div align="justify">All users who are minors in the jurisdiction in which they reside (generally under the age of 18) must have the permission of, and be directly supervised by, their parent or guardian to use the Site. If you are a minor, you must have your parent or guardian read and agree to these Terms of Use prior to you using the Site.  </div><div></div><div align="center"><b>INTELLECTUAL PROPERTY RIGHTS</b> </div><div align="justify">Unless otherwise indicated, the Site is our proprietary property and all source code, databases, functionality, software, website designs, audio, video, text, photographs, and graphics on the Site (collectively, the Content) and the trademarks, service marks, and logos contained therein (the Marks) are owned or controlled by us or licensed to us, and are protected by copyright and trademark laws and various other intellectual property rights and unfair competition laws of the United States, international copyright laws, and international conventions. The Content and the Marks are provided on the Site AS IS for your information and personal use only. Except as expressly provided in these Terms of Use, no part of the Site and no Content or Marks may be copied, reproduced, aggregated, republished, uploaded, posted, publicly displayed, encoded, translated, transmitted, distributed, sold, licensed, or otherwise exploited for any commercial purpose whatsoever, without our express prior written permission. </div><div align="justify">Provided that you are eligible to use the Site, you are granted a limited license to access and use the Site and to download or print a copy of any portion of the Content to which you have properly gained access solely for your personal, non-commercial use. We reserve all rights not expressly granted to you in and to the Site, the Content and the Marks.  </div><div></div><div align="center"><b>USER REPRESENTATIONS</b> </div><div align="justify">By using the Site, you represent and warrant that: (1) all registration information you submit will be true, accurate, current, and complete; (2) you will maintain the accuracy of such information and promptly update such registration information as necessary;(3) you have the legal capacity and you agree to comply with these Terms of Use;(4) you are not a minor in the jurisdiction in which you reside, or if a minor, you have received parental permission to use the Site; (5) you will not access the Site through automated or non-human means, whether through a bot, script or otherwise; (6) you will not use the Site for any illegal or unauthorized purpose; and (7) your use of the Site will not violate any applicable law or regulation. </div><div align="justify">If you provide any information that is untrue, inaccurate, not current, or incomplete, we have the right to suspend or terminate your account and refuse any and all current or future use of the Site (or any portion thereof). </div><div></div><div align="center"><b>USER REGISTRATION</b> </div><div align="justify">You may be required to register with the Site. You agree to keep your password confidential and will be responsible for all use of your account and password. We reserve the right to remove, reclaim, or change a username you select if we determine, in our sole discretion, that such username is inappropriate, obscene, or otherwise objectionable.  </div><div></div><div align="center"><b>PRODUCTS</b> </div><div align="justify">All products are subject to availability. We reserve the right to discontinue any products at any time for any reason. Prices for all products are subject to change.  </div><div></div><div align="center"><b>PURCHASES AND PAYMENT</b> </div><div align="justify">We accept the following forms of payment: </div><div>- Visa</div><div>- Mastercard</div><div>- American Express</div><div>- Discover</div><div>- Razorpay</div><div></div><span><br></span><div align="justify">You agree to provide current, complete, and accurate purchase and account information for all purchases made via the Site. You further agree to promptly update account and payment information, including email address, payment method, and payment card expiration date, so that we can complete your transactions and contact you as needed. Sales tax will be added to the price of purchases as deemed required by us. We may change prices at any time. All payments shall bein INR or USD. </div><div align="justify">You agree to pay all charges at the prices then in effect for your purchases and any applicable shipping fees, and you authorize us to charge your chosen payment provider for any such amounts upon placing your order. We reserve the right to correct any errors or mistakes in pricing, even if we have already requested or received payment. </div><div align="justify">We reserve the right to refuse any order placed through the Site. We may, in our sole discretion, limit or cancel quantities purchased per person, per household, or per order. These restrictions may include orders placed by or under the same customer account, the same payment method, and/or orders that use the same billing or shipping address. We reserve the right to limit or prohibit orders that, in our sole judgment, appear to be placed by