ripts to send comments or messages, or using any data mining, robots, or similar data gathering and extraction tools.</div><div align="justify">10. Interfere with, disrupt, or create an undue burden on the Site or the networks or services connected to the Site.</div><div align="justify">11. Attempt to impersonate another user or person or use the username of another user.</div><div align="justify">12. Sell or otherwise transfer your profile.</div><div align="justify">13. Use any information obtained from the Site in order to harass, abuse, or harm another person.</div><div align="justify">14. Use the Site as part of any effort to compete with us or otherwise use the Site and/or the Content for any revenue-generating endeavor or commercial enterprise.</div><div align="justify">15. Decipher, decompile, disassemble, or reverse engineer any of the software comprising or in any way making up a part of the Site.</div><div align="justify">16. Attempt to bypass any measures of the Site designed to prevent or restrict access to the Site, or any portion of the Site.</div><div align="justify">17. Harass, annoy, intimidate, or threaten any of our employees or agents engaged in providing any portion of the Site to you.</div><div align="justify">18. Delete the copyright or other proprietary rights notice from any Content.</div><div align="justify">19. Copy or adapt the Sites software, including but not limited to Flash, PHP, HTML, JavaScript, or other code.</div><div align="justify">20. Upload or transmit (or attempt to upload or to transmit) viruses, Trojan horses, or other material, including excessive use of capital letters and spamming (continuous posting of repetitive text), that interferes with any partys uninterrupted use and enjoyment of the Site or modifies, impairs, disrupts, alters, or interferes with the use, features, functions, operation, or maintenance of the Site.</div><div align="justify">21. Upload or transmit (or attempt to upload or to transmit) any material that acts as a passive or active information collection or transmission mechanism, including without limitation, clear graphics interchange formats (gifs), 11 pixels, web bugs, cookies, or other similar devices (sometimes referred to as spyware or passive collection mechanisms or pcms).</div><div align="justify">22. Except as may be the result of standard search engine or Internet browser usage, use, launch, develop, or distribute any automated system, including without limitation, any spider, robot, cheat utility, scraper, or offline reader that accesses the Site, or using or launching any unauthorized script or other software.</div><div align="justify">23. Use the Site in a manner inconsistent with any applicable laws or regulations.</div><div align="justify">24. Disparage, tarnish, or otherwise harm, in our opinion, us and/or the Site.  </div><div></div><div align="center"><b>USER GENERATED CONTRIBUTIONS</b> </div><div align="justify"><div>The Site may invite you to chat, contribute to, or participate in blogs, message boards, online forums, and other functionality, and may provide you with the opportunity to create, submit, post, display, transmit, perform, publish, distribute, or broadcast content and materials to us or on the Site, including but not limited to text, writings, video, audio, photographs, graphics, comments, suggestions, or personal information or other material (collectively, "Contributions"). Contributions may be viewable by other users of the Site and the Marketplace Offerings and through third-party websites. As such, any Contributions you transmit may be treated as non-confidential and non-proprietary. When you create or make available any Contributions, you thereby represent and warrant that: </div><div>1. The creation, distribution, transmission, public display, or performance, and the accessing, downloading, or copying of your Contributions do not and will not infringe the proprietary rights, including but not limited to the copyright, patent, trademark, trade secret, or moral rights of any third party.</div><div></div><span>2. You are the creator and owner of or have the necessary licenses,rights, consents, releases, and permissions to use and to authorize us, theSite, and other users of the Site to use your Contributions in any mannercontemplated by the Site and these Terms of Use.<br>3. You have the written consent, release, and/or permission of each andevery identifiable individual person in your Contributions to use the name orlikeness of each and every such identifiable individual person to enableinclusion and use of your Contributions in any manner contemplated by the Siteand these Terms of Use.<br>4. Your Contributions are not false, inaccurate, or misleading.<br>5. Your Contributions are not unsolicited or unauthorized advertising,promotional materials, pyramid schemes, chain letters, spam, mass mailings, orother forms of solicitation.<br>6. Your Contributions are not obscene, lewd, lascivious, filthy, violent,harassing, libelous, slanderous, or otherwise objectionable (as determined byus).<br>7. Your Contributions do not ridicule, mock, disparage, intimidate, orabuse anyone.<br>8. Your Contributions do not advocate the violent overthrow of anygovernment or incite, encourage or threaten physical harm against another.<br>9. Your Contributions do not violate any applicable law, regulation, orrule.<br>10. Your Contributions do not violate the privacy or publicity rights ofany third party.<br>11. Your Contributions do not contain any material that solicits personalinformation from anyone under the age of 18 or exploits people under the age of18 in a sexual or violent manner.<br>12. Your Contributions do not violate any applicable law concerning childpornography, or otherwise intended to protect the health or well-being ofminors;<br>13. Your Contributions do not include any offensive comments that areconnected to race, national origin, gender, sexual preference, or physicalhandicap.<br></span><div>14. Your Contributions do not otherwise violate or link to material that violates, any provision of these Terms of Use, or any applicable law or regulation. </div><div>Any use of the Site or the Marketplace Offerings in violation of the foregoing violates these Terms of Use and may result in, among other things, termination or suspension of your rights to use the Site and the Marketplace Offerings.  </div></div><div></div><div align="center"><b>CONTRIBUTION LICENSE</b> </div><div align="justify">By posting your Contributions to any part of the Site, you automatically grant, and you represent and warrant that you have the right to grant, to us an unrestricted, unlimited, irrevocable, perpetual, non-exclusive, transferable, royalty-free, fully-paid, worldwide right, and license to host, use, copy, reproduce, disclose, sell, resell, publish, broadcast, retitle, archive, store, cache, publicly perform, publicly display, reformat, translate, transmit, excerpt (in whole or in part), and distribute such Contributions (including, without limitation, your image and voice) for any purpose, commercial, advertising, or otherwise, and to prepare derivative works of, or incorporate into other works, such Contributions, and grant and authorize sublicenses of the foregoing. The use and distribution may occur in any media formats and through any media channels. </div><div align="justify">This license will apply to any form, media, or technology now known or hereafter developed, and includes our use of your name, company name, and franchise name, as applicable, and any of the trademarks, service marks, trade names, logos, and personal and commercial images you provide. You waive all moral rights in your Contributions, and you warrant that moral rights have not otherwise been asserted in your Contributions. </div><div align="justify">We do not assert any ownership over your Contributions. You retain full ownership of all of your Contributions and any intellectual property rights or 