(5, 'privacy_policy', '<div align="center"><h1>PRIVACY NOTICE</h1></div><div align="center"><b>Last updated on September 2020</b></div><div align="justify"><div><span>Thank you for choosing to be part of our community at LMS Creatr (<b>Company</b>,<b>we</b>, <b>us</b>, or <b>our</b>). We are committed to protecting yourpersonal information and your right to privacy. If you have any questions orconcerns about this privacy notice, or our practices with regards to yourpersonal information, please contact us at lms@techonika.com.</span><span><span>When you and more generally, use any of our services (the "<b>Services</b>",which include the </span><span xss=removed><span xss=removed><span xss=removed><span xss=removed>Thank you for choosing to be part of our community at LMS Creatr (<b>Company</b>, <b>we</b>, <b>us</b>, or <b>our</b>). </span><span xss=removed><span xss=removed><span xss=removed><span xss=removed>Thank you for choosing to be part of our community at LMS Creatr (<b>Company</b>, <b>we</b>, <b>us</b>, or <b>our</b>). </span><span xss=removed><span xss=removed><span xss=removed><span xss=removed>Thank you for choosing to be part of our community at AR Finance Room (<b>Company</b>, <b>we</b>, <b>us</b>, or <b>our</b>). </span><span xss=removed><span xss=removed><span xss=removed><span xss=removed>Thank you for choosing to be part of our community at LMS Creatr (<b>Company</b>, <b>we</b>, <b>us</b>, or <b>our</b>). </span><span xss=removed><span xss=removed><span xss=removed><span xss=removed>Thank you for choosing to be part of our community at LMS Creatr (<b>Company</b>, <b>we</b>, <b>us</b>, or <b>our</b>). </span>Thank you for choosing to be part of our community at LMS Creatr (Company, we, us, or our). We are committed to protecting your personal information and your right to privacy. If you have any questions or concerns about this privacy notice or our practices with regard to your personal information, please contact us at lms@techonika.com.<br>When you and more generally, use any of our services (the "Services", which include the ), we appreciate that you are trusting us with your personal information. We take your privacy very seriously. In this privacy notice, we seek to explain to you in the clearest way possible what information we collect, how we use it, and what rights you have in relation to it. We hope you take some time to read through it carefully, as it is important. If there are any terms in this privacy noticethat you do not agree with, please discontinue use of our Services immediately. This privacy notice applies to all information collected through our Services (which, as described above, includes our ), as well as any related services, sales, marketing, or events. <b>Please read this privacy noticecarefully as it will help you understand what we do with the information that we collect.</b> </div><div></div><div><b>TABLE OF CONTENTS</b></div><div>1. WHAT INFORMATION DO WE COLLECT?</div><div>2. WILL YOUR INFORMATION BE SHARED WITH ANYONE?</div><div>3. DO WE USE COOKIES AND OTHER TRACKING TECHNOLOGIES?</div><div>4. HOW DO WE HANDLE YOUR SOCIAL LOGINS?</div><div>5. IS YOUR INFORMATION TRANSFERRED INTERNATIONALLY?</div><div>6. HOW LONG DO WE KEEP YOUR INFORMATION?</div><div>7. DO WE COLLECT INFORMATION FROM MINORS?</div><div>8. WHAT ARE YOUR PRIVACY RIGHTS?</div><div>9. CONTROLS FOR DO-NOT-TRACK FEATURES</div><div>10. DO CALIFORNIA RESIDENTS HAVE SPECIFIC PRIVACY RIGHTS?</div><div><a rel="" target=""> </a>11. DO WE MAKE UPDATES TO THIS NOTICE?</div><div>12. HOW CAN YOU CONTACT US ABOUT THIS NOTICE? </div><div></div><div><b>1. WHAT INFORMATION DO WE COLLECT?</b></div><div></div><div><b>The personal information you disclose to us</b> <span><b><i>In Short:</i></b><i>Wecollect information that you provide to us.</i></span> We collect personal information that you voluntarily provide to us when you register on our portal or express an interest in obtaining information about us or our products and services, when you participate in activities (such as by posting messages in our online forums or entering competitions, contests or giveaways) or otherwise when you contact us. The personal information that we collect depends on the context of your interactions with us, the choices you make, and the products and features that you use. The personal information that we collect may include the following:</div><div><span><b>SocialMedia Login Data.</b><span> We mayprovide you with the option to register with us using your existing socialmedia account details, like your Facebook, Twitter or other social mediaaccount. If you choose to register in this way, we will collect the informationdescribed in the section called "<u>HOW DO WE HANDLE YOUR SOCIAL LOGINS</u>"below.</span>All personal information that you provide to us must be true, complete and accurate, and you must notify us of any changes to such personal information.</div><div></div><div><b>Information automatically collected</b> <span><b><i>In Short:</i></b><i>Someinformation  such as your Internet Protocol (IP) address and/or browser anddevice characteristics  is collected automatically when you visit our website.</i></span>  We automatically collect certain information when you visit, use or navigate the website. This information does not reveal your specific identity (like your name or contact information) but may include device and usage information, such as your IP address, browser and device characteristics, operating system, language preferences, referring URLs, device name, country, location, information about who and when you use our and other technical information. This information is primarily needed to maintain the security and operation of our website, and for our internal analytics and reporting purposes.  Like many businesses, we also collect information through cookies and similar technologies. </div><div></div><div><b>2. WILL YOUR INFORMATION BE SHARED WITH ANYONE?</b></div><div><span><b><i>In Short:</i></b><b></b><i>We only shareinformation with your consent, to comply with laws, to provide you withservices, to protect your rights, or to fulfill business obligations.</i></span>We may process or share your data that we hold based on the following legal basis:</div><ul> <li><b>Consent:</b> We may process your data if you have given us specific consent to use your personal information on a specific purpose.<span><br>     <br>     <br>     </span></li> <li><b>Legitimate Interests:</b> We may process your data when it is reasonably necessary to achieve our legitimate business interests.<span><br>     <br>     <br>     </span></li> <li><b>Performance of a Contract:</b>Where we have entered into a contract with you, we may process your personal information to fulfill the terms of our contract.<span><br>     <br>     <br>     </span></li> <li><b>Legal Obligations:</b> We may disclose your information where we are legally required to do so in order to comply with applicable law, governmental requests, a judicial proceeding, court order, or legal process, such as in response to a court order or a subpoena (including in response to public authorities to meet national security or law enforcement requirements).<span><br>     <br>     <br>     </span></li> <li><b>Vital Interests:</b> We may disclose your information where we believe it is necessary to investigate, prevent, or take action regarding potential violations of our policies, suspected fraud, situations involving potential threats to the safety of any person and illegal activities, or as evidence in litigation in which we are involved.</li></ul>More specifically, we may need to process your data or share your personal information in the following situations:<ul> <li><b>Business Transfers.</b>We may share or transfer your information in connection with, or during negotiations of, any merger, sale of company assets, financing, or acquisition of all or a portion of our business to another company.</li></ul><ul> <li><b>Affiliates.</b>We may share your information with our affiliates, in which case we will require those affiliates to honour this privacy notice. Affiliates include our parent company and any subsidiaries, joint venture partners or other companies that we control or that are under common control with us.</li></ul><ul> <li><b>Business Partners.</b>We may share your information with our business partners to offer you certain products, services, or promotions.</li></ul><ul> <li><b>Other Users.</b>When you share personal information or otherwise interact with public areas of the website, such personal information may be viewed by all users and may be publicly made available outside the in perpetuity. If you interact with other users of the Company and register with us through a social network (such as Facebook), your contacts on the social network will see your name, profile photo, and descriptions of your activity. Similarly, other users will be able to view descriptions of your activity, communicate with you within our, and view your profile.</li></ul><div><b>3. DO WE USE COOKIES AND OTHER TRACKING TECHNOLOGIES?</b></div><div><span><b><i>In Short:</i></b><b></b><i>We may use cookiesand other tracking technologies to collect and store your information.</i></span>We may use cookies and similar tracking technologies (like web beacons and pixels) to access or store information. Specific information about how we use such technologies and how you can refuse certain cookies is set out in our Cookie Notice. </div><div></div><div><b>4. HOW DO WE HANDLE YOUR SOCIAL LOGINS?</b></div><div><span><b><i>In Short:</i></b><b></b><i>If you choose toregister or log in to our services using a social media account, we may haveaccess to certain information about you.</i></span>The Company offers you the ability to register and login using your third-party social media account details (like your Facebook or Twitter logins). Where you choose to do this, we will receive certain profile information about you from your social media provider. The profile Information we receive may vary depending on the social media provider concerned, but will often include your name, email address, friends list, profile picture as well as other information you choose to make public on such social media platform. We will use the information we receive only for the purposes that are described in this privacy noticeor that are otherwise made clear to you on the relevant . Please note that we do not control, and are not responsible for, other uses of your personal information by your third-party social media provider. We recommend that you review their privacy notice to understand how they collect, use and share your personal information, and how you can set your privacy preferences on their sites and apps. </div><div></div><div><b>5. IS YOUR INFORMATION TRANSFERRED INTERNATIONALLY?</b> <span><b><i>In Short:</i></b><b></b><i>We may transfer,store, and process your information in countries other than your own.</i></span> Our servers are located in India. If you are accessing our website from outside, please be aware that your information may be transferred to, stored, and processed by us in our facilities and by those third parties with whom we may share your personal information (see "WILL YOUR INFORMATION BE SHARED WITH ANYONE?" above) in other countries. If you are a resident in the European Economic Area, then these countries may not necessarily have data protection laws or other similar laws as comprehensive as those in your country. We will however take all necessary measures to protect your personal information in accordance with this privacy noticeand applicable law. </div><div></div><div><b>6. HOW LONG DO WE KEEP YOUR INFORMATION?</b></div><div><span><b><i>In Short:</i></b><b></b><i>We keep yourinformation for as long as necessary to fulfill the purposes outlined in thisprivacy noticeunless otherwise required by law.</i></span>We will only keep your personal information for as long as it is necessary for the purposes set out in this privacy notice, unless a longer retention period is required or permitted by law (such as tax, accounting or other legal requirements). When we have no ongoing legitimate business need to process your personal information, we will either delete or anonymize such information, or, if this is not possible (for example, because your personal information has been stored in backup archives), then we will securely store your personal information and isolate it from any further processing until deletion is possible. </div><div></div><div><b>7. DO WE COLLECT INFORMATION FROM MINORS?</b></div><div><span><b><i>In Short:</i></b><b></b><i>We do not knowinglycollect data from or market to children under 18 years of age.</i></span>We do not knowingly solicit data from or market to children under 18 years of age. By using our services, you represent that you are at least 18 or that you are the parent or guardian of such a minor and consent to such minor dependents use of the Services. If we learn that personal information from users less than 18 years of age has been collected, we will deactivate the account and take reasonable measures to promptly delete such data from our records. If you become aware of any data we may have collected from children under age 18, please contact us at contact@arfinanceroom.com. </div><div></div><div><b>8. WHAT ARE YOUR PRIVACY RIGHTS?</b></div><div><span><b><i>In Short:</i></b><b></b><i>You may review,change, or terminate your account at any time.</i></span><span>If you are resident in the European Economic Area and you believe we areunlawfully processing your personal information, you also have the right tocomplain to your local data protection supervisory authority. You can findtheir contact details here:<a href="http://ec.europa.eu/justice/data-protection/bodies/authorities/index_en.htm" target="_blank" rel="">http://ec.europa.eu/justice/data-protection/bodies/authorities/index_en.htm</a>.</span><span>If you are resident in Switzerland, the contact details for the dataprotection authorities are available here: <a href="https://www.edoeb.admin.ch/edoeb/en/home.html" target="_blank" rel="">https://www.edoeb.admin.ch/edoeb/en/home.html</a>.</span></div><div><b>Account Information</b> If you would at any time like to review or change the information in your account or terminate your account, you can reach out to us. Upon your request to terminate your account, we will deactivate or delete your account and information from our active databases. However, we may retain some information in our files to prevent fraud, troubleshoot problems, assist with any investigations, enforce our Terms of Use and/or comply with applicable legal requirements.</div><div><span><b>Opting out of email marketing:</b><b></b>You can unsubscribefrom our marketing email list at any time by clicking on the unsubscribe linkin the emails that we send or by contacting us using the details providedbelow. You will then be removed from the marketing email list  however, we maystill communicate with you, for example to send you service-related emails thatare necessary for the administration and use of your account, to respond toservice requests, or for other non-marketing purposes. To otherwise opt-out,you may email to us at lms@techonika.com.</span></div><div></div><div><b>9. CONTROLS FOR DO-NOT-TRACK FEATURES</b></div><div>Most web browsers and some mobile operating systems and mobile applications include a Do-Not-Track (DNT) feature or setting you can activate to signal your privacy preference not to have data about your online browsing activities monitored and collected. At this stage, no uniform technology standard for recognizing and implementing DNT signals has been finalized. As such, we do not currently respond to DNT browser signals or any other mechanism that automatically communicates your choice not to be tracked online. If a standard for online tracking is adopted that we must follow in the future, we will inform you about that practice in a revised version of this privacy notice. </div><div></div><div><b>10. DO CALIFORNIA RESIDENTS HAVE SPECIFIC PRIVACY RIGHTS?</b></div><div><span><b><i>In Short:</i></b><b></b><i>Yes, if you are aresident of California, you are granted specific rights regarding access toyour personal information.</i></span>California Civil Code Section 1798.83, also known as the Shine The Light law, permits our users who are California residents to request and obtain from us, once a year and free of charge, information about categories of personal information (if any) we disclosed to third parties for direct marketing purposes and the names and addresses of all third parties with which we shared personal information in the immediately preceding calendar year. If you are a California resident and would like to make such a request, please submit your request in writing to us using the contact information provided below. If you are under 18 years of age, reside in California, and have a registered account with, you have the right to request the removal of unwanted data that you publicly post on the website. To request the removal of such data, please contact us using the contact information provided in this policy, and include the email address associated with your account and a statement that you reside in California. We will make sure the data is not publicly displayed on the website, but please be aware that the data may not be completely or comprehensively removed from all our systems (e.g. backups, etc.).  </div><div></div><div><b>11. DO WE MAKE UPDATES TO THIS NOTICE?</b></div><div><span><b><i>In Short:</i></b><b></b><i>Yes, we will updatethis notice as necessary to stay compliant with relevant laws.</i></span>We may update this privacy noticefrom time to time. The updated version will be indicated by an updated Revised date and the updated version will be effective as soon as it is accessible. If we make material changes to this privacy notice, we may notify you either by prominently posting a notice of such changes or by directly sending you a notification. We encourage you to review this privacy noticefrequently to be informed of how we are protecting your information. </div><div></div><div><b>12. HOW CAN YOU CONTACT US ABOUT THIS NOTICE?</b> If you have questions or comments about this notice, you may email us at lms@techonika.com.</div><div></div><div><b>HOW CAN YOU REVIEW, UPDATE, OR DELETE THE DATA WE COLLECT FROM YOU</b></div><div>Based on the applicable laws of your country, you may have the right to request access to the personal information we collect from you, change that information, or delete it in some circumstances. To request to review, update, or delete your personal information, please submit a request form on the contact us page. We will respond to your request within 30 days. </div></div>'),
