(3, 5, 11, 1, 'course', 1559001600, NULL, 0, 'Best'),
(5, NULL, NULL, NULL, 'course', 1605225600, NULL, 0, NULL),
(6, 5, 15, 5, 'course', 1604620800, NULL, 1, 'Amazing course. Being a beginner in excel, I was looking for a course that would take me from the very basic to advanced level in an easy to understand and simple language. Finally found one. Thank you ARFR !'),
(7, 4, 16, 5, 'course', 1604620800, NULL, 1, 'Great course, referring to my friends as well ! thank you'),
(8, 5, 17, 5, 'course', 1605225600, NULL, 1, 'I had already done some classes for excel earlier but since I am following Techonika on Linkedin and also since some of my friends recommended this, I purchased this course and I can say without a doubt that this was the best one. They took me from the very basic to advanced level in a smooth transition. Kudos guys !'),
(9, 5, 18, 5, 'course', 1604620800, NULL, 0, 'Great work, the shortcuts will help me to increase my speed and efficiency while working on Excel.'),
(10, 4, 19, 5, 'course', 1604620800, NULL, 1, 'Amazing course ! Looking forward to more such content'),
(11, 5, 21, 8, 'course', 1604620800, NULL, 1, 'Dear Team,"It has been great to start the advanced excel and financial modelling course from Techonika.The way video has been recorded, you feel that you are connected with the trainer. very nicely and minutely explained all the tricks of financial modelling and excel. This is surely a value addition in my portfolio."'),
(12, 5, 24, 11, 'course', 1605225600, NULL, 1, 'I took this course since one of my friends recommended this and I can say without a doubt that it was an amazing course. Every concept of Excel, Financial Statements, Financial Modelling, Valuations and Mergers & Acquisitions has been explained in a very simple manner. Highly recommended !'),
(13, 5, 27, 5, 'course', 1606521600, NULL, 0, '');
