(129, 1, '2020-09-11 09:47:41', '2020-09-11 09:47:41', '<h3><img class="aligncenter wp-image-58" src="http://localhost/Phpproject/Wordpress/shayari/wp-content/uploads/2020/08/images-1-1.jpg" alt="" width="1000" height="749" /></h3>\r\n<h3>1:-na koi kisi se door hota hai</h3>\r\nna koi <a href="https://shayari8008.blogspot.com/">kisi se door</a> hota hai\r\nna koi kisi ke krib hota hai\r\nwo khud he chal ke aata hai\r\njo jiska nasib hota hai\r\n<h3>2:-Teri har muskan se mili</h3>\r\nTera Saath hai Toh mujhe kya kami hai\r\nTeri har muskan se <a href="https://www.facebook.com/Shayari-122698729534658">mili mujhe kushi hai</a>\r\nMuskuraate Rehna isi Tarah humesha\r\nKyonki teri is muskan mein meri jaan basi hai\r\n<h3>3:-Tumko Dekhna Chahti hai</h3>\r\nJab bhi <a href="https://www.facebook.com/groups/297189378061267">Dekhta hu Tumhe</a>\r\nLagta hai ye Din Naya hai\r\nNigahein Tumko Dekhna Chahti hai\r\nMere Dilko ye kya hua hai', 'English Shayari', '', 'inherit', 'closed', 'closed', '', '11-revision-v1', '', '', '2020-09-11 09:47:41', '2020-09-11 09:47:41', '', 11, 'http://localhost/Phpproject/Wordpress/shayari/2020/09/11/11-revision-v1/', 0, 'revision', '', 0),
